import logo from './logo.svg';
import './App.css';
import NavTabs from './navTab';


const App = () => {
  const tabMap = [
    { 'name': 'a' ,'href': '/a'},
    { 'name': 'b' ,'href': '/b'},
    { 'name': 'c' ,'href': '/c'},
  ];


  return (
    <div className="App">
      <header className="App-header">
        <NavTabs tabMap={tabMap} />
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
      </header>
    </div>
  );
}

export default App;
